import RoleData from './user_roles.json'
import './../App.css';

class App extends Component {

  state = {
    items: []
  } 
  componentDidMount() {
      this.setState({
        items: RoleData
      }); 
      console.log(RoleData);
  }


  render() {
    return (
      <div>
        <p>{ this.state.items.id}</p>
      </div>
    );
  }
}

export default App;
